import Input from '../UI/Input'
import './MealItemForm.css'


function MealItemForm(){
    return(
        
            <form className='form'>
                <Input 
                    label='Amount'
                    Input={{
                        id:'amount',
                        type:'number',
                        min:'1',
                        max:'5',
                        defaultValue:'1'
                    }}
                    />
                <button> Add</button>
            </form>
        


    )
}

export default MealItemForm
